import { useParams } from "react-router-dom";

const MeetupDetail = () => {

    const params = useParams ();

    console.log ( params.meetupId );

    return (
        <section>
            <h1>Meetup Detail</h1>
            <p>{ params.meetupId }</p>
        </section>
    );
}

export default MeetupDetail;
